    false,nt"url": null,nt"notes": "This dataset contains geochemical data
    for soils collected in the United States and analyzed in the analytical laboratories
    of the Geologic Division of the U.S. Geological Survey (USGS). These data represent
    analyses of soil samples collected in support of various USGS programs. The data
    were originally entered into the in-house PLUTO database which was used by the Geologic
    Division from the mid- 1970's through the mid-1990's to archive geochemical data.
    A portion of the PLUTO data base is published as: Baedecker, P.A., Grossman, J.N.,
    and Buttleman, K.P., 1998, National Geochemical Data base: PLUTO geochemical data
    base for the United States: U.S. Geological Survey Digital Data Series DDS-47. The
    data presented here are derived from DDS-47.",nt"license_title": null,nt"extras":
